         id="tspan360">Vi bor direkte ud til de naturskønne arealer </tspan><tspan

         y="69.027"
         id="tspan370">sikker ferieoplevelse ud af et længere ophold eller </tspan><tspan

    <text
       xml:space="preserve"

       id="text334"><tspan
         
         y="0"
         id="tspan306">På herregården Odden vises over 800 skitser </tspan><tspan
         
         y="11.5045"
         id="tspan308">og værker af J.F. Willumsen. I 70 år virkede han </tspan><tspan
         
         y="23.009001"
         id="tspan310">som maler, billedhugger, grafiker, keramiker og </tspan><tspan
         
         y="34.5135"
         id="tspan312">arkitekt og var med til at udforme den moderne </tspan><tspan
         
         y="46.018002"
         id="tspan314">danske kunst. Samlingens skaber, Victor Petersen, </tspan><tspan
         
         y="57.522499"
         id="tspan316">introducerer i en film hans liv og kunst. Den </tspan><tspan
         
         y="69.027"
         id="tspan318">gamle hestestald rummer en udstilling om Oddens </tspan><tspan
         
         y="80.531502"
         id="tspan320">historie. I herregårdens køkken serveres kaffe, te og </tspan><tspan
         
         y="92.036003"
         id="tspan322">bagværk.</tspan><tspan
         
         y="108.5375"
         id="tspan324">Oddenvej 31, Mygdal</tspan><tspan
         
         y="120.042"
         id="tspan326">9800 Hjørring</tspan><tspan
         
         y="131.54649"
